To initialize a sweep in wandb, you need to provide the sweep configuration dictionary to `wandb.sweep()` and optionally provide the name of the project for the `project` parameter where you want the output of the W&B Run to be stored. The `wandb.sweep()` function returns the sweep ID. Here is an example code snippet:

```python
sweep_configuration = {
    'method': 'random',
    'name': 'sweep',
    'metric': {
        'goal': 'maximize', 
        'name': 'val_acc'
        },
    'parameters': {
        'batch_size': {'values': [16, 32, 64]},
        'epochs': {'values': [5, 10, 15]},
        'lr': {'max': 0.1, 'min': 0.0001}
     }
}

sweep_id = wandb.sweep(sweep=sweep_configuration, project="project-name")
``` 

The `sweep_configuration` dictionary specifies the configuration for the sweep. You can define the hyperparameters to be tuned under the `parameters` key of the dictionary. Once you have initialized the sweep, you can start the sweep agent with `wandb.agent()` API call.

