You can create a masked image and log it in wandb using `wandb.Image()` with the `masks` keyword argument. To log an overlay, provide a dictionary with the following keys and values to the `masks` keyword argument of wandb.Image: `mask_data`, a 2D NumPy array containing an integer class label for each pixel, or a `path` string to a saved image mask file, or `class_labels`: an optional dictionary mapping the integer class labels in the image mask to their readable class names.

Here is an example:

```python
import wandb
import numpy as np

mask_data = np.array([[1, 2, 2, ... , 2, 2, 1], ...])

class_labels = {
  1: "tree",
  2: "car",
  3: "road"
}

# Create a wandb.Image object with masks keyword argument
mask_img = wandb.Image(image, masks={
  "predictions": {
    "mask_data": mask_data,
    "class_labels": class_labels
  },
  "ground_truth": {
    ...
  },
  ...
})

# Log the wandb.Image object
wandb.log({"masked_image": mask_img})
```

You can also log segmented masks in a table in wandb. To do this, you will need to provide a `wandb.Image` object for each row in the table. Here is an example:

```python
import wandb
import numpy as np

ids = [1, 2, 3]
images = [...] # a list of image arrays
labels = [...] # a list of label arrays

class_labels = {
  1: "tree",
  2: "car",
  3: "road"
}

table = wandb.Table(columns=['ID', 'Image'])

for id, img, label in zip(ids, images, labels):
    mask_img = wandb.Image(img, masks = {
        "prediction" : {
            "mask_data" : label,
            "class_labels" : class_labels
        },
        ...
    })
    table.add_data(id, mask_img)

wandb.log({"Masked_Images": table})
``` 

